      no_proxy: "{{ os_coe_cluster_template_no_proxy | default(omit, True) }}"
      verify: "{{ os_coe_cluster_template_verify | default(omit, True) }}"
      state: "{{ os_coe_cluster_template_state | default(omit, True) }}"
      https_proxy: "{{ os_coe_cluster_template_https_proxy | default(omit, True) }}"
