      api_timeout: "{{ os_coe_cluster_template_api_timeout | default(omit, True) }}"
      auth: "{{ os_coe_cluster_template_auth | default(omit, True) }}"
      image_id: "{{ os_coe_cluster_template_image_id | default(omit, True) }}"
      volume_driver: "{{ os_coe_cluster_template_volume_driver | default(omit, True) }}"
      registry_enabled: "{{ os_coe_cluster_template_registry_enabled | default(omit, True) }}"
